/*
 MongoDB Capture the Flag setup script
 
 This file sets up three challenges using MongoDB, the user to complete the last challenge, captures the flag.

 The exercises progress in difficulty from easy to hard, the answer to the last exercise is the password to the next exercise.

 How to run the script:

 mongo admin -u madmin -p mongoctf ctf_setup.js

 Requirements:
   - mongod process running with authentication (mongod --auth)
   - A user in the admin database with the following credentials for the root role: madmin/mongoctf:

   db.getSiblingDB("admin").createUser({
       user: "madmin",
       pwd: "mongoctf",
       roles: [ "root" ]
     });

*/



/*
  LEVEL01 CHALLENGE

  Starting point, to connect: mongo <HOSTNAME>/level01 -u level01 -p level01
*/

// Drop level01 user/database if it exists
db.getSiblingDB("level01").dropDatabase();
db.getSiblingDB("level01").dropUser("level01");

// Create level01 read only user
db.getSiblingDB("level01").createUser({ user: "level01", pwd: "level01", roles: [ "read" ] });
printjson("[level01] Created user");

// Create the first challenge
db.getSiblingDB("level01").instructions.insert({ "level" : 1, "description" : "Welcome to MongoDB Capture the Flag! " + 
	"Your first challenge is to query the level01.comments collection to find a single document " + 
	"with the name 'Mongo' as the commenter's name, this document will provide instructions for moving " + 
	"on to challenge #2.  Once connected to challenge #2, query the instructions collection to " + 
	"determine your next steps" });
printjson("[level01] Inserted instructions");

//level01 password for level02
var level02_pw = new ObjectId();

// Insert documents for level01
for (var i=0; i<1000; i++) {

	// insert our solution document half way through the workload
	if (i == 500) {
		db.getSiblingDB("level01").comments.insert( { "_id" : level02_pw, "name" : "Mongo", "comment" : "You've found the answer to level01!  To continue to level02, connect to the 'level02' database, use the username 'level02', the password is the _id of this document" });
	}
	else {
		db.getSiblingDB("level01").comments.insert({ "name" : "Mngo", "comment" : "Lorem ipsum dolor sit amet, cum nisl persecuti ei. Dolor clita detraxit eu mei, blandit mandamus urbanitas at eum. Aperiam dissentiunt ad has. Sea te scribentur theophrastus, esse debet perfecto vis ex. Ea est dolorum feugait salutandi. Vis no aeque legendos philosophia."});	
	}
}
printjson("[level01] Finished inserting exercise data");





/*
  LEVEL02 CHALLENGE

  Students can only get to this challenge after completeing level01
*/

// Drop level02 user/database if it exists
db.getSiblingDB("level02").dropDatabase();
db.getSiblingDB("level02").dropUser("level02");

// Create level02 read only user
db.getSiblingDB("level02").createUser({ user: "level02", pwd: level02_pw.str, roles: [ "read" ] });
printjson("[level02] Created user");

// Create the second challenge
db.getSiblingDB("level02").instructions.insert({ "level" : 2, "description" : "Welcome to level02.  There is one document within " + 
	"the 'level02.blog' collection with 23 array elements (the field name is not known), find the document for instructions to the " +
	"next level" });
printjson("[level02] Inserted instructions");

//level01 password for level02
var level03_pw = new ObjectId();

// Insert documents for level02
for (var i=0; i<1000; i++) {

	// create a blog document
	var doc = { "date" : new ISODate(), "headline" : "Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore",
				"author" : {
					"name" : "yMsbj7HoblywVevfYbuZkq00r",
					"title" : "HM3YP0XhC1W6BwEFth2nstZzP",
					"authorid" : ObjectId("54f74bfb12b0c1ab9d5b843e")
				} };

	// insert 10 random array fields with random lengths to the document
	for (var j=0; j<10; j++) {
		var field_name = i + j;
		var newArray = [];
		var numItems = Math.floor(Math.random() * 20);

		for (var k = 0; k<numItems; k++) {
		    newArray.push(k);
		}

		doc[String(field_name)] = newArray;
	}

	// insert our solution document half way through the workload
	if (i == 250) {
		var answerArray = [];
		for (var j=0; j<23; j++) { 
			answerArray.push(j);
		}
		doc["81"] = answerArray;
		doc.headline = "You've found the answer to level02!  To continue to level03, use the username 'level03', the password is the _id of this document";
		doc._id = level03_pw;

		db.getSiblingDB("level02").blog.insert( doc );
	}
	else {
		db.getSiblingDB("level02").blog.insert(doc);	
	}

}
printjson("[level02] Finished inserting exercise data");





/*
  LEVEL03 CHALLENGE

  Students can only get to this challenge after completeing level02
*/
// Drop level03 user/database if it exists
db.getSiblingDB("level03").dropDatabase();
db.getSiblingDB("level03").dropUser("level03");

// Create level03 read only user
db.getSiblingDB("level03").createUser({ user: "level03", pwd: level03_pw.str, roles: [ "read" ] });
printjson("[level03] Created user");

// Create the third challenge
db.getSiblingDB("level03").instructions.insert({ "level" : 3, "description" : "Welcome to level03 (the final level)! " +
	" To complete the final challenge, use two collections in this database ('states' and 'earthquakes30days') to determine " + 
	" the number of earthquakes in Alaska and California in the past 30 days. " + 
	" The password to continue is '<EARTHQUAKES IN ALASKA>_<EARTHQUAKES_IN_CA>' (1 underscore in-between), username 'level04', database 'level04'" });
