loadLevel03DataStatePolygons();
printjson("[level03] Finished inserting exercise data: state polygons");

loadLevel03DataEarthquakes30Days();
printjson("[level03] Finished inserting exercise data: earthquakes past 30 days");




/*
  LEVEL04 CHALLENGE

  Tell them they've won!
*/
// Drop level03 user/database if it exists
db.getSiblingDB("level04").dropDatabase();
db.getSiblingDB("level04").dropUser("level04");

// Create level03 read only user
db.getSiblingDB("level04").createUser({ user: "level04", pwd: "96_32", roles: [ "read" ] });
printjson("[level04] Created user");

// Create the third challenge
db.getSiblingDB("level04").instructions.insert({ "level" : 4, "description" : "Congratulations, you've made it to the end!" });
printjson("[level04] Inserted instructions");


printjson("[Complete]");
printjson("[Complete]");
